('1789','18','7538','Villa APM Santa Ponsa',Null,'Moderne Villa in ruhiger Wohnlage von Santa Ponsa','21987','Zum Jachthafen und zum Strand sind es nur wenige Gehminuten. Die sich im Bau befindende Villa wird  mit hochwertigen Materialien und modernster Technik ausgestattet und wird April 2013 fertig erstellt sein.\r\nDie ca. 725 m² bebaute Fläche verteilt sich auf 2 Wohnebenen. Insgesamt entstehen außer einem großzügigen, hellen Wohn-Esszimmer, einer Luxusküche auch noch 4 Schlafzimmer mit je ein Bad en suite. Im Untergeschoss finden 4 Autos Platz. Im Außenbereich entsteht ein mediterraner, pflegeleichter Garten mit Pool und Grillplatz.','21988','4500000','111','2012-04-11 12:12:30','106','2012-04-11 12:13:04',Null,'1387','121','673',1,'1','0',Null,Null,Null,'21989',Null,'0','0','0',Null,'2015-09-22 09:59:59',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'21990',Null,'21991',Null,'21992',Null,'21993',Null,'21994','0',0,'4');
